CREATE SEQUENCE IF NOT EXISTS public.city_id_seq AS integer START WITH 153661 INCREMENT BY 1 NO MINVALUE NO MAXVALUE CACHE 1;

CREATE TABLE public.city
(
   id integer NOT NULL DEFAULT nextval('public.city_id_seq'::regclass) PRIMARY KEY,
   name character varying(255) NOT NULL,
   state_id integer NOT NULL,
   state_code character varying(255) NOT NULL,
   country_id integer NOT NULL,
   country_code character(2) NOT NULL,
   latitude numeric(10,8) NOT NULL,
   longitude numeric(11,8) NOT NULL,
   created_date timestamp with time zone,
   last_modified_date timestamp with time zone,
   enabled boolean DEFAULT true NOT NULL,
   wiki_data_id character varying(255)
);

COMMENT ON COLUMN public.city.wiki_data_id IS 'Rapid API GeoDB Cities';

ON CONFLICT DO NOTHING;